			[50747] = {
			},
			[55394] = {
				["reward_text"] = "This power once belonged to my flight, passed down through my mother when she was empowered by the Titan, Eonar.\r\n\r\n<Merithra lowers her head for a moment.>\r\n\r\nIf you are to use it to help save our world, then we must first bind these fragments together.",
				["progress_text"] = "Have you collected the shards?",
