				},
			},
			[48767] = {
				["reward_text"] = "By the Light! I thought I lost it forever!\n\nThis used to belong to my great grandfather.\n\n<Myra clutches the necklace close to her heart for a moment as a tear runs down her cheek. After a moment, she looks around, shaking her head.>\n\nNothing here can remotely repay this. It's not much, but I can show you how to get the most out of mining monelite seams.\n\n<Myra spends the next several minutes explaining several techniques to increase the amount of monelite mined from a seam.>",
